import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
import { Facebook, Twitter, Instagram } from "react-feather";

function Navbar(props) {
  let { home, login, sign, social } = props;

  return (
    <div className="navbar-container">
      <div className="navbar-logo">
        <Link to="/">
          <img className="logo-img" src="./images/logo-img.png" alt="#" />
        </Link>
      </div>
      <div className="navbar-buttons">
        {login && (
          <Link className="navbar-btn" to="/login">
            {social ? "Giriş" : "Hesabın varm mı ? Giriş Yap"}
          </Link>
        )}
        {sign && (
          <Link className="navbar-btn" to="/sign">
            {social ? "Kaydol" : "Hesabın yok mu ? Kaydol"}
          </Link>
        )}
        {social && (
          <div className="social-container">
            <Facebook className="icon-social" color="white" />
            <Twitter className="icon-social" color="white" />
            <Instagram className="icon-social" color="white" />
          </div>
        )}
      </div>
    </div>
  );
}

export default Navbar;
